import React from 'react';


class TableItems extends React.Component {

    render() {
        return (
            <div>
                <div>
                    <div class="ui celled ordered list">
                        <div class="item">Cats</div>
                        <div class="item">Horses</div>
                        <div class="item">Dogs
                        </div>
                    </div>

                </div>
            </div>
        );
    }
}

export default TableItems;
